import React from 'react';
import { useSelector } from 'react-redux';
import Gallery from '../modals/Gallery.jsx';
import RemoveChannel from '../modals/Main.jsx';
import RenameChannel from '../modals/Story.jsx';

const ModalComponent = () => {
  const modal = useSelector((state) => state.modal);
  const { show, type } = modal;

  const setModal = {
    gallery: <Gallery show={show} />,
    main: <RemoveChannel show={show} />,
    story: <RenameChannel show={show} />,
    closed: null,
  };

  return (
    <div>
      {setModal[type]}
    </div>
  );
};

export default ModalComponent;
